import React from 'react';
import Form from './form.js';
import Result from './results.js';
import Loader from './loader.js';
import History from './history.js';
import Help from './help.js';
import superagent from 'superagent';
import { Switch, Route } from 'react-router-dom';
import { If, Then, When, Unless } from 'react-if';
// import './form.scss';
import './_reset.scss';

class Main extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      loading: false,
      count: 0,
      sessionCounter: 0,
      results: [],
      history: [],
      url: '',
      route: '',
      body: ''
    }
  }

  handleForm = (count, results, url, route) => {
    this.setState({ count, results, url, route });
  }
  handleHistory = (url, route, body) => {
    this.setState({ url, route, body });
  }
  handleUrl = (url) => {
    this.setState({ url });
  }
  handleRoute = (route) => {
    this.setState({ route });
    console.log(`inside handleRoute ${this.state.route}`);
  }
